def get_emotion(character, mood):
  if mood == "freak":
    return freak(character)
  elif mood == "whine":
    return whine(character)
  elif mood == "sleep":
    return sleep(character)
  elif mood == "happy":
    return happy(character)
  elif mood == "dancing":
    return dancing(character)
  else:
    return [dead(), dead()]
